.registerHeader{
    position: absolute;
    align-self:self-end ;
    width: 100%;
    height: 5.6875rem;
    background-color: rgba(255, 255, 255, 0);
    justify-content: center;
}
.registerHeaderInner{
    display: flex;
    margin: auto;
    justify-content: space-between;
    width: 96%;
    height: 98%;
}
.registerLogo{
    width: 167px;
}
.registerAuthLinks{
    border: none;
    color: #E50914;
    background-color: rgba(255, 255, 255, 0);
    font-family: Arial, Helvetica, sans-serif;
    font-size: 20px;
    width: 90px;
    height: 60px;
}
.registerAuthLinks:hover{
    text-decoration: underline;
    cursor: pointer;
}
